import pizzaHeader from './images/pizzaHeader.png'

const Home = () => {
	return (
		<>
			<img className="pizzaHeader" src={pizzaHeader} alt="pizzaHeader">
				<div id="headerLine" class="headerLineLeft"></div>
			</img>
			{/* <div id="headerLine" class="headerLineRight"></div> */}
		</>
	)
}

export default Home
